import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import './fonts.css';
import {background, secondary} from './colors.js';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
  circle: {
    position: 'absolute',
    top: '80%',
    left: theme.spacing(8),
    transform: 'translateY(-50%)',
    width: '75px',
    height: '75px',
    borderRadius: '50%',
    backgroundColor: secondary, // Replace with your desired color
  },
  appBarTheme: { flexGrow: 1 },
  buttonTheme: { 
    color: secondary,
    fontWeight: "bold",
    fontFamily: "Montserrat",
    verticalAlign: 'bottom',
    display: 'inline-block',
    width: '7%',
    fontSize: '0.7em',
    letterSpacing: '0.1em'
  },
  firstLetter: { fontSize: '1.3em' }
}));

const appBarTheme = { flexGrow: 1 }
const buttonTheme = { color: secondary,
                      fontWeight: "bold",
                      fontFamily: "Montserrat",
                      verticalAlign: 'bottom',
                      display: 'inline-block',
                      width: '7%',
                      fontSize: '0.7em',
                      letterSpacing: '0.1em'};
const firstLetter = { fontSize: '1.3em' };

export default function SimpleAppBar() {
  const classes = useStyles();
  return (
    <Box sx={appBarTheme}>
      <AppBar position="static" sx={{background: background, boxShadow:'none'}}>
        <Toolbar>
          {/* <div>
           <div className={classes.circle}></div>
           </div> */}
           <div>
          <Button style={classes.buttonTheme}><span style={classes.firstLetter} >C</span>ontact</Button>
          <Button style={classes.buttonTheme}><span style={classes.firstLetter} >L</span>inks</Button>
          <Button style={classes.buttonTheme}><span style={classes.firstLetter} >R</span>esume</Button>
          </div>
        </Toolbar>
      </AppBar>
    </Box>
  );
}
